import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Login from "./login";
import HomePage from "./HomePage";
import './App.css';

function App() {
  return (
        <main>
          <Router>
              <Routes>
                  <Route path="/" element={<Login />} />
                </Routes>
              </Router> 

            <Router>
            <Routes>
              <Route path="/home" element={<HomePage />} />
              </Routes>
            </Router> 
            </main>
  );
}

export default App;
